import React from 'react';
import { Provider } from 'react-redux';
import store from './redux/store';
import SongsPage from './pages/SongsPage';
import StatisticsPage from './pages/StatisticsPage';

const App = () => {
  return (
    <Provider store={store}>
      <div>
        <h1>My App</h1>
        <SongsPage />
        <StatisticsPage />
      </div>
    </Provider>
  );
};

export default App;
